window.bookSummaryJSON = "<p>They came from the Deep...and with the first major content patch for Sosaku Online. </p> <p>Arriving in a tide of blood and horror, a forgotten cult from the depths of the ocean has laid waste to the once glorious city of Sehkem and scattered its people throughout the empire. </p> <p>The global storyline is in full swing, and James is all over it. Tasked with a critical mission by the god of death, Kheph and Kjara must make their way back to Sehkem, find their way past the invading army, and retrieve an ancient artifact from the depths of an ancient tomb. </p> <p>Sounds easy, right? Yeah...not so much.</p>"; 
